import { useEffect } from "react";
import { Navigate } from "react-router-dom";

const Protected = (props) => {

    const {Component} = props;

    useEffect(() => {
        let login = localStorage.getItem('login');
        if(!login){
            Navigate('login')
        }
    }, [])
    return (
        <div>

        < Component/>
        </div>
    )
}
export default Protected;
